package leetcode;

// 214. Shortest Palindrome
public class Question214 {
    int resultLen = Integer.MAX_VALUE;

    public String shortestPalindrome(String s) {
        int strLen = s.length();
        if (strLen < 2) {
            return s;
        }
        resultLen = Integer.MAX_VALUE;
        for (int start = 0; start < (strLen + 1) / 2; start++) {
            getShortedChange(s, start, start, strLen);
            getShortedChange(s, start, start + 1, strLen);
        }
        String result = s.substring(strLen - resultLen);

        String reversedSubstring = new StringBuilder(result).reverse().toString();
        return reversedSubstring + s;
    }

    private void getShortedChange(String s, int begin, int end, int strLen) {
        while (0 <= begin && end < strLen && s.charAt(begin) == s.charAt(end)) {
            begin--;
            end++;
        }
        if (begin == -1 && resultLen > (strLen - end)) {
            resultLen = strLen - end;
        }
    }

    public static void main(String[] args) {
        Question214 solution = new Question214();
        // String s = "aacecaaa"; // "aaacecaaa"
        String s = "";

        System.out.println(solution.shortestPalindrome(s));
    }
}
